import React from 'react';

function Sidebar(){
    return (        
        <div id="navbar">
        <hr/>
            <div><p class="c1">Home</p><hr/></div>
            <div><p class="c1">Study Matireals</p><hr/></div>
            <div><p class="c1">Courses</p><hr/></div>
            <div><p class="c1">Software</p><hr/></div>
            <div><p class="c1">Career opportunities</p><hr/></div>
            <div><p class="c1">Internships</p><hr/></div>
            <div><p class="c1">abc xyz</p><hr/></div>    
        </div>);
}

export default sidebar;
